import React from 'react'
import { useState, useEffect } from "react";

function Home () {
  const [datas, setDatas] = useState([]);

  useEffect(() => {
    // GraphQL query
    const graphqlQuery = `
      {
        getPodcastSeries(name:"This American Life"){
          uuid
          name
          itunesId
          description
          imageUrl
          itunesInfo{
            uuid
            publisherName
            baseArtworkUrlOf(size: 640)
          }
          episodes{
            uuid
            name
            description
            audioUrl
          }
        }
      }
    `;

    fetch('https://api.taddy.org/${graphql}', {
      headers: {
        'Content-Type': 'application/json',
        "X-USER-ID": 706,
        "X-API-KEY": "71d748931a7cd592d4724deac9cabeb566291c1257d3da3e408d5a2628bd24d2794ba22f9d650f03f87aec6d072fc55f2f",
      },
      body: JSON.stringify({ query: graphqlQuery }),
    })
    .then((response) => response.json())
    .then((data) => { setDatas([data.data.getPodcastSeries]); })

    .catch((error) => {
        console.error('Error fetching podcast series:', error);
      });
    }, []);

    return (
      <div>
      <h3>Home</h3>
      <p>{datas}</p>
      </div>
    )
}

export default Home
